desc:
RSS News - это скрипт для создания новостных сайтов. Скрипт (агрегатор) делает импорт новостей из RSS-источников и сохраняет их с изображениями (если они найдены) в базу данных.

Особенности RSS News:

- Адаптивный дизайн с использованием Bootstrap 3;
- Удобная панель управления;
- Неограниченные категории;
- Неограниченные источники RSS;
- Неограниченные страницы;
- Импорт новостей из любого типа канала (RSS или Atom);
- Импорт новостей вручную и автоматически;
- Smarty Templates Engine для большей гибкости в редактировании тем;
- Места для рекламных блоков;
- LazyLoad для изображения;
- Файлы Sitemap (категории, новости);
- Disqus комментарии;
- Поддержка Open Graph для изображении;
- RTL поддержка;
- и другое...

Корпоративное решение, созданное специально для бюро переводов или отдела переводов компании. Программа устанавливается на компьютер, ноутбук или планшет для Windows, имеет максимальные возможности для настройки и позволяет переводить документы и большие объемы текстов.


PROMT Expert 19 рекомендуется:

для поддержки проектов по переводу технической документации, контрактов и других типовых документов;

для работы с корпоративными базами Translation Memory (ТМ), словарями и глоссариями;

для регулярных переводов текстов схожей тематики с высоким качеством;

для эффективной работы с терминологией (автоматическое выделение терминов из текста и использование ранее созданных словарей и глоссариев);

для повышения эффективности переводческого процесса в рамках бюро или отдела переводов.

Как результат – ускорение процесса перевода.

Это не просто скрипты… Это готовое решение для Ваших поздравительных открыток!

В этом комплекте готовые скрипты по разным тематикам, в каждый шаблон интегрированы все необходимые элементы, а также написана инструкция с пояснениями.

Работать с таким комплектом невероятно просто, так что даже если Вы ни разу не видели ни одного скрипта – Вы справитесь, а видео уроки в этом помогут...

Коллекция уникальных скриптов 2.0;

35 уникальных скриптов;
7 видео уроков;
Комплект изображений отредактированных в фотошопе, специально для установки на поздравительные вирусные открытки;
HTML- редактор для сайтов. Легок в обращении, не требует специальных знаний и занимает очень мало места на Вашем компьютере.

KL 005.10: Kaspersky Security for Windows Server
Курс готовит к проектированию, внедрению и обслуживанию продукта Kaspersky Security for Windows Server. В процессе изучения подробно разбирается:


зачем он нужен и где использовать;
какие задачи решает;
в чем его отличие от стандартной антивирусной защиты Kaspersky Endpoint Security;
расширенные средства защиты от угроз.
Особое внимание уделяется компонентам системы, их настройке и тестированию работоспособности дополнительных механизмов защиты, таких как Anti-malware protection, Anti-Cryptor, Untrusted host blocking, необходимых для эффективного и своевременного обеспечения информационной безопасности и реагирования на различные угрозы для серверных ОС в средних и больших организациях.

Курс предназначен для системных администраторов сетей Microsoft Windows, специалистов по защите информации, специалистов технической поддержки.

После окончания обучения вы научитесь:


описывать возможности продукта Kaspersky Security for Windows Server;
эффективно использовать встроенные системы локального, а также централизованного управления и конфигурирования;
оперативно реагировать на современные угрозы, понимать их особенности и этапы выполнения;
проектировать и выполнять внедрение системы антивирусной защиты высоконагруженных, терминальных, файловых, серверов печати и приложений Windows, построенной на базе Антивируса Kaspersky Security for Windows Server;
осуществлять обслуживание, резервное копирование и аудит внедренной системы на всех стадиях эксплуатации.

Данный онлайн-курс является начальной ступенью по изучению базовых принципов программирования в системе “1С:Предприятие” и предназначен для обучения 1С-программированию “с нуля”.
Особенности курса
Основная цель курса: сформировать у слушателей базовые практические навыки, связанные с разработкой собственных или доработкой существующих прикладных решений, работающих на платформе “1С:Предприятие”. Будет много практики – как на самих вебинарах, так и при выполнении домашних заданий под постоянным контролем преподавателя.

В результате прохождения онлайн-курса Вы без особого труда сможете:

- создать новый справочник, документ, регистр и т.п.;

- написать свою собственную процедуру на языке программирования 1С;

- “прикрутить” нужную кнопку на управляемую форму;

- написать запрос к базе данных;

- настроить отчет или печатную форму под требования пользователей;

- и многое другое…

Кроме того, полученные знания будут являться необходимой базой для дальнейшего углублённого изучения механизмов платформы “1С:Предприятие” и прохождения соответствующих онлайн-курсов.

Ни для кого не секрет, что программное обеспечение фирмы “1С” для автоматизации управления и учёта на предприятиях находит широкое применение не только в России, но и в других странах. В связи с этим на рынке труда очень востребована профессия “программист 1С”, что в сочетании с достойными зарплатами делает эту профессию весьма привлекательной.

1С:ERP 2 – это инновационное решение для автоматизации работы предприятия, созданное на основе платформы «1С:Предприятие 8.3». Оно разработана на основе лучших мировых и отечественных практик автоматизации бизнеса. Программа незаменима для крупных и средних предприятий.

Курс рекомендован сотрудникам планово-экономических служб, финансовым директорам, консультантам по управленческому учету и всем, кто знаком с методиками управленческого учета и формирования управленческой отчетности. Проводится по единой методике, утвержденной компанией 1С.
Как учитывать затраты, распределять и отражать их? Как рассчитывать себестоимость, учитывать активы, обязательства и доходы? А главное – как планировать финансовый результат? Всё это Вы научитесь делать во время обучения. Вы изучите функционал программы 1С:ERP 2 и её подсистем в части учета активов и пассивов предприятия. Практическая работа в рамках курса построена с применением сквозной задачи.

По окончании курса Вы будете уметь:

получать необходимые сведения из базы данных с помощью настраиваемых отчетов;
корректно исправлять допущенные ошибки;
знать концепцию учёта затрат и операции по их отражению;
распределять затраты;
формировать нормативно-справочную информацию, необходимую для учета движения денежных средств, доходов, расходов, активов и пассивов;
применять принципы ввода начальных остатков активов и пассивов предприятия для целей управленческого учета;
работать с обязательствами;
распределять доходы и расходы по направлениям деятельности;
рассчитывать себестоимости;
формировать финансовый результат.

Программа

