— Подведение итогов.

Вы программист или хотите им быть? Между прочим, это всё ещё перспективная специальность в наш «век информации» для вас и ваших детей. Кроме того, именно программисты чаще всего переходят в новые специальности, связанные с информационными технологиями, которых не было ещё пару лет назад. Будучи программистом и повышая свои знания, вы всегда будете актуальным на рынке труда и актуальным для самого себя.

В видеокурсе Программист 2020..2030 раскрываются темы, которые находятся «в работе» и будут наиболее популярны в программирование на ближайшие 10 лет: цифровая экономика (биткойн, блокчейны, смарт-контракты), искусственный интеллект (нейросети, современная робототехника), большие данные (из соц.сетей, наука о данных, статистическая обработка, бизнес применение). Также продолжатся разработки прошлых десятилетий: веб-сайты, игры для смартфонов и планшетов, облачные сервисы.

Как начинающему, так и опытному программисту обязательно необходимо быть внимательным к новым тенденциям, чтобы не остаться без работы в ближайшие несколько лет. И это не шутки: кому сейчас нужно программирование на языках Паскаль и Дельфи? А ведь всего 10 лет назад эти специалисты были очень востребованы. Но не волнуйтесь, со мной вам не о чем волноваться. Ведь я (Bad_guy) последние 15 лет сосредоточен на выпуске видеокурсов для программистов, крэкеров и хакеров. Будьте уверены, Видеокурс Программист 2020..2030, созданный мной, вам точно поможет. В видеоуроках приводится как креативная теоретическая часть, которая обязательно подкинет отличную идею, в какую сторону можно двигаться самостоятельно, так и практика, то есть, непосредственное изучение языков программирование и написание кода.

Кстати, если вы видите себя больше хакером, а не программистом, то популярные в ближайшие 10 лет вышеприведенные темы (более подробно раскрытые в видеокурсе), и вам дадут пищу для ума и поле для деятельности.


В Видеокурс Программист 2020..2030 входит аж более 440 свежих видеоуроков (и это рекорд!) по изучению таких языков программирования, как:

Java программирование в Android Studio приложений для смарфтонов и планшетов Android;
Swift - программирование приложений в среде Xcode под Apple (iPod, iPad, Macbook);
C++ и фреймворк Qt, позволяющий делать кроссплатформенные приложения с окнами и формами в стиле Windows-программ;
C# (си-шарп) - наиболее быстрое и популярное программирование под Windows;
перспективный язык Golang, разработанный компанией Google
язык R, используемый математиками и статистиками для обработки "больших данных" Big Data и Data Science;
а также языки, удобные для создания сайтов в связке: Python (для серверного бэкэнд программирования), Javascipt (для браузерного фронтэнд программирования) и mySQL (для работы с базой данных сайта).
+ ПОДАРОК! Секретный видеокурс не о конкретном языке программирования, а о насущных вопросах для каждого начинающего и опытного программиста. Если вы спросите почему я избрал именно эти языки программирования, отвечу просто: они самые популярные и перспективные сейчас, а число вакансий по ним даже сейчас велико и в ближайшие 10 лет будет только расти.
Заботливо отсканированные популярные книги по программированию, выпущенные в 2017..2019 годах, вы также найдёте на видеокурсе. Их тут более 120 штук. Видеоуроки хороши для быстрого старта "с нуля", но в них невозможно осветить все тонкости. А более опытным программистам, наилучшим вариантом отточить навыки и повысить скиллы, являются книги. Не буду приводить здесь полный список, одно скажу: это те самые топовые книги по программированию на русском языке, которые все читают. Все популярные языки программирования тут раскрыты.

Unity3D базовый курс (разработка игр на Unity3D для начинающих);
Unity3D углубленный курс (моделирование и анимация в 3ds max и многое другое);
Монетизация мобильных игр (создание мобильной 2d игры на Unity3D, ее публикация и способы ее монетизации).

Курс, с которого вам стоит начать, если вы хотите &quot;войти в IT&quot;

В программе курса:

Вспоминаем азы школьной математики, которые понадобятся нам в дальнейшем обучении;
Учимся элементарной логике;
Разбираемся - как считать биты и байты;
Вспоминаем - что такое &quot;файл&quot;, &quot;путь&quot; и изучаем, как устроены файловые системы;
Узнаем тайны текстовых кодировок;
Сравниваем между собой Windows и Linux, изучаем главные отличия;
Рассматриваем протокол HTTP и понимаем, как он устроен (спойлер - очень просто!);
Заканчиваем знакомством с понятиями &quot;значение&quot;, &quot;тип&quot;, &quot;переменная&quot; в одном из несложных языков программирования.
Подготовительный курс, строго рекомендуемый каждому к прохождению до того, как вы решитесь на покупку любого профессионального курса.

SECURE PHONE
Создадим телефон на примере ОС ANDROID
С защитой от перехвата сетевого трафика;
С оповещением о подмене Базовой Станции (БС);
Выбрав прошивку с открытым исходным кодом, либо удалив встроенные в стандартную прошивку бекдоры (да, да, такие есть практически в каждой!);
Зашифровав и сделав его устойчивым к криминалистической экспертизе;
Обсудим методы бекапа и восстановления, а также шифрования для безопасного хранения;
Поговорив об антивирусах для Андроид: есть ли в них толк и какой выбрать?
Осветив сервисы автоматического определения номера звонящего, а также сервисы автоматической записи звонков стандарта GSM и мессенджеров;
Выяснив наиболее безопасные мессенджеры из 3-х доминирующих типов (федеративные, централизованные и p2p);
Защитив sim-карт, виды рута и фреймворков для изменения функция ОС «на лету»;
Используя VPN для смартфона;
Защитив DNS телефона от подмены;
Задействовав фаерволы для Android;
Защитив от прослушивание микрофон смартфона сторонними приложениями;
Безопасное удалив файлы, с четким пониманием почему нельзя отдавать телефон в ремонт или продавать без предварительной отчистки.

HACK PHONE
Телефон как средство пентестера, который всегда под рукой
Телефон как загрузочная флешка для взлома и администрирования Windows;
Телефон как средство BAD UASB для доставки полезной нагрузки;
Net Hunter и виды его установки, непосредственно на телефон, или как элемент прошивки Смартфона;


Тестирование безопасности роутеров через смартфон;
Настройка и оптимизация Termux для работы с root-правами и пентестерскими фреймворками для «подручного» тестирования
